Интересуюсь историей родов:
Щукины (в 1890-е жили в Назимихе, Щелково), Шныриковы (Филатовы) и Германовы  (в 1900-е жили в Гурьево, Смоленская обл);
Фомичевы (1900-е, с. Старая Ситня); Глазовы, Игнатовы (1900-е, Воскресенки, Шматово, Байдиково), Халявкины (Болхуны, В. Баскунчак)
